import './App.css';
import React from 'react'
import Home from '../components/Home'

function App() {
  return (
    <div className = "App">
      <header className="App-header">
        <p>
          Potato Party: Hash It Out
        </p>
      </header>
      <Home />
    </div>
  );
}

export default App;
